import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import LocalMovieData from '../data/localData'
import { BookSeat } from '../store/counterSlice'

function MovielList() {
  const movie = useSelector((state)=>state.counter.seat)
  const MovieData =LocalMovieData
  const dispatch =useDispatch()
  const handelclick =(ele)=>{
    dispatch(BookSeat(ele))

  }

  return (
    <div>{
      MovieData.map((el,key)=>
      <div key={key}>
      <p>{el.Title}</p>
      <button onClick={()=>handelclick(el)}>BOOK MOVIE </button>
      </div>)
      }

    </div>
  )
}

export default MovielList
